import React from "react";

function ColorItemInput(props) {
  return (
    <input
      id={props.colorItemColor}
      type="radio"
      name="color"
      checked={props.color === props.colorItemColor}
      onChange={() => props.setColor(props.colorItemColor)}
    />
  );
}
function ColorItemLabel(props) {
  return (
    <label
      htmlFor={props.colorItemColor}
      style={{
        backgroundColor: props.colorItemColor,
      }}
    ></label>
  );
}

function CreateAreaColor(props) {
  return (
    <div className="create-color">
      {/* Yellow */}
      <ColorItemInput
        colorItemColor="#f8c51b"
        color={props.color}
        setColor={props.setColor}
      />
      <ColorItemLabel colorItemColor="#f8c51b" />

      {/* Red */}
      <ColorItemInput
        colorItemColor="#f96262"
        color={props.color}
        setColor={props.setColor}
      />
      <ColorItemLabel colorItemColor="#f96262" />

      {/* LightBlue */}
      <input
        id="#23d5e7"
        type="radio"
        name="color"
        checked={props.color === "#23d5e7"}
        onChange={() => props.setColor("#23d5e7")}
      />
      <label
        htmlFor="#23d5e7"
        style={{
          backgroundColor: "#23d5e7",
        }}
      ></label>

      {/* Purple */}
      <input
        id="#dda6F7"
        type="radio"
        name="color"
        checked={props.color === "#dda6F7"}
        onChange={() => props.setColor("#dda6F7")}
      />
      <label
        htmlFor="#dda6F7"
        style={{
          backgroundColor: "#dda6F7",
        }}
      ></label>

      {/* DarkBlue */}
      <input
        id="#2198d3"
        type="radio"
        name="color"
        checked={props.color === "#2198d3"}
        onChange={() => props.setColor("#2198d3")}
      />
      <label
        htmlFor="#2198d3"
        style={{
          backgroundColor: "#2198d3",
        }}
      ></label>
    </div>
  );
}

export default CreateAreaColor;
